import React, { Component } from "react";
import {
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";
  import Home from "./Home";
  import Football from "./Football";
  import Basketball from "./Basketball";
  import Soccer from "./Soccer";
class Main extends Component {
  render() {
    return (
        <HashRouter>
        <div>
          <h1>Simple SPA</h1>
          <ul className="header">
            <li><NavLink exact to="/">Home</NavLink></li>
            <li><NavLink to="/Football">Foo</NavLink></li>
            <li><NavLink to="/Basketball">Contact</NavLink></li>
            <li><NavLink to="/Favorite Books">Favorite Books</NavLink></li>
          </ul>
          <div className="content">
          <Route exact path="/" component={Home}/>
            <Route path="/stuff" component={Football}/>
            <Route path="/contact" component={Basketball}/>
            <Route path="/Favorite Books" component={Soccer}/>
          </div>
        </div>
        </HashRouter>
    );
  }
}

export default Main;
